import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import sdata from "./Sdata";

console.log(sdata[0].name);

ReactDOM.render(
  <>
    <Card
      name={sdata[0].name}
      imgsrc={sdata[0].imgsrc}
      title={sdata[0].title}
      link={sdata[0].link}
    />
    <Card
      name={sdata[1].name}
      imgsrc={sdata[1].imgsrc}
      title={sdata[1].title}
      link={sdata[1].link}
    />
    <Card
      name={sdata[2].name}
      imgsrc={sdata[2].imgsrc}
      title={sdata[2].title}
      link={sdata[2].link}
    />
    <Card
      name={sdata[3].name}
      imgsrc={sdata[3].imgsrc}
      title={sdata[3].title}
      link={sdata[3].link}
    />
    <Card
      name={sdata[4].name}
      imgsrc={sdata[4].imgsrc}
      title={sdata[4]}
    />
  </>,
  document.getElementById("root")
);
